import React from 'react'
import Game from '../Game'
import {playingGame} from "../../utils/data"



const GamesList = (props) => {
  const {searchValue} = props
    return (
      <div id="list">
        {playingGame.map((game) =>
          <Game name={game.name} mode={game.mode} genre={game.genre} />
        )}
          </div>
    )

}

export default GamesList
